let page=getUrlParam("page");let hnums;if(!page||page<=0){page=1}function getPages(){$.getJSON("/api/hack/getpages",function(a){hnums=a.pages})}function loadMain(b,c,d,a){b=(b==null)?-1:b;c=(c==null||c.length===0)?"":c;d=(d==null||d.length===0)?"":d;a=(a==null)?-1:a;$.getJSON("/api/hack/list?page="+page+"&pid="+b+"&hacker="+c+"&committer="+d+"&result="+a,function(e){let hackPages=$("#hackPage");pageList(hackPages,page,hnums);let list=$("#hackList tbody");list.empty();for(let i=0;i<e.length;i++){let t=e[i];let r='<span class="label label-default">Waiting</span>';if(t.result===2){r='<span class="label label-success">Success</span>'}else{if(t.result===1){r='<span class="label label-danger">Failed</span>'}}list.append(HTML.tr(HTML.td(HTML.a("hack.jsp?id="+t.id,t.id))+HTML.td(HTML.a("code.jsp?sid="+t.sid,t.sid))+HTML.td(HTML.a("problem.jsp?pid="+t.pid,t.pid+" - "+t.title))+HTML.td(getStyleName(t.hacker))+HTML.td(getStyleName(t.committer))+HTML.td(HTML.a("hack.jsp?id="+t.id,r))+HTML.td(t.date)))}})}function toPage(a){page=a;let pid=$("#hackProblemSelect").val();let hacker=$("#hackUser").val();let committer=$("#commitUser").val();let res=$("#hackResultSelect  option:selected").val();loadMain(pid,hacker,committer,res)}function hackSearch(){page=1;getPages();let pid=$("#hackProblemSelect").val();let hacker=$("#hackUser").val();let committer=$("#commitUser").val();let res=$("#hackResultSelect  option:selected").val();loadMain(pid,hacker,committer,res)}getPages();toPage(page);document.onkeydown=function(a){if((a.keyCode||a.which)==13){hackSearch()}};